import React from "react";
import "./About.css"

function About() {
  return (
    <section id="About Us">
      <h1>About Us</h1>
      <p className='text'>
        Founded in 2013, Compugnear offer quality IT solutions for home and
        business users at a price that everyone can afford. Our customers will
        always receive one-on-one personal attention at a very affordable price.
        Our customers will receive the highest quality of customer service
        available.
      </p>
    </section>
  );
}

export default About;
